    public static class DbInitializer
    {
        /// <summary>
        /// Initialize DB
        /// </summary>
        /// <param name="context"></param>
        public static void Initialize(EmployeeDBContext context)
        {
            //Check if DB is seed with employees then seed is not require.
            context.Database.EnsureCreated();

            if (context.Employees.Any())
            {
                return;
            }

            try
            {                
                var employees = EmployeeSeeds(context);

                AddressSeeds(context, employees);
            }
            catch (Exception)
            {
                //In case of any failures in drop created DB. 
                context.Database.EnsureDeleted();
                throw;
            }

        }

